import React from 'react';
import { Link } from 'react-router-dom';
import './notFound.css';


const NotFound = () => {
  return (
    <div>
      <h1>404 - Page Not Found</h1>
      <p>The page you are looking for doesn't exist.</p>
      <Link to="/login">Go to Login</Link>
    </div>
  );
};

export default NotFound;
